from programs.leetcode.two_sum import Solution


def test_case1():
    s1 = Solution()
    returned_list = s1.twoSum(nums=[2, 7, 11, 15], target=9)
    expected_list = [0, 1]

    assert returned_list == expected_list


def test_case2():
    s1 = Solution()
    returned_list = s1.twoSum(nums=[-1, 0], target=-1)
    expected_list = [0, 1]

    assert returned_list == expected_list


def test_case3():
    s1 = Solution()
    returned_list = s1.twoSum(nums=[-3, 3, 4, 90], target=0)
    expected_list = [0, 1]

    assert returned_list == expected_list


